Program: |+1
 // Method Tasks:
 // Transform the given absolute coordinate into gantry coordinates
 //
 // Parameters	: Gantry, the gantry for which we calculate the position
 //				  Position, the absolute position in a frame
 //
 // ReturnValues : array of coordinate of the crane
 //---------------------------------------------------------------------------------
 
 param Gantry: object, Position: real[3] -> real
 
 var a:real[3] := Gantry._3D.getMUAnimationPosition(0)
 var b:real[3] := Gantry._3D.getMUAnimationPosition(1)
 
 var fp: real[3] := calcDroppedPerpendicularFootPoint(a, b, Position)
 
 // calculate the distance between A and FP
 return (fp-a).magnitude
